import bram from '../images/Bram Stoker.jpeg';
import anne from '../images/Anne Bonny.jpeg';
import Carousel from 'react-bootstrap/Carousel';

function Home() {
    return (
        // <div>
            <Carousel className='banner'>
                <Carousel.Item>
                    <img className="d-block w-100" id="bram" src={bram} alt="Bram Stoker" />
                    <Carousel.Caption>
                        <h3 className='overlay'>Bram Stoker</h3>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img className="d-block w-100" id="anne" src={anne} alt="Anne Bonny" />
                    <Carousel.Caption>
                        <h3 className='overlay'>Anne Bonny</h3>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>
        // </div>
    )
}

export default Home;
